import { UseWeather, useweather } from "../Hooks/Userweatherget";
import userweather from "../Atom/userweather";

const weather = () => {
  const { weather, error, loading } = UseWeathereather();
//   console.log(weather);
  return (
    <div>
      {loading && <h2>loading weather...</h2>}
      {error.length > 0 && <h2>{error}</h2>}
      {weather.length > 0
        ? weather.map((weather) => (
            <userweather
            key={weather.id}
              currentweather={weather.currentweather}
              timezone={weather.timezone}
            />
            // <userweather
            //   key={weather.id}
            //   currentweather={weather.currentweather}
            //   timezone={weather.timezone}
            // />
          ))
        : loading && <h2>no not known</h2>}
    </div>
  );
};
export default weather;
